import React from "react";

const ItemCard = () => {
    return (
        <div className="w-80 p-2 bg-white rounded-lg">
            <div className="img_container p-8 bg-bgGray rounded-lg">
                <img src={require('../assets/index1.jpg')} alt="image" />
            </div>
            <div className="product_info mt-2">
                <h5 className="text-xl font-semibold">Product</h5>
                <p className="mt-1 text-slate-400">description</p>
                <div className="flex justify-between">
                    <h6 className="mt-8 font-bold text-lg">price</h6>
                    <button className="w-8 h-8 mt-8 bg-blue-400 text-white rounded-full bottom-3">+</button>
                </div>
            </div>
        </div>
    )
}

export default ItemCard;
